  constructor(
    // Whether to be rendered server-side or client-side
    @Inject(PLATFORM_ID) private platformId: Object
  ) { }


  ngAfterViewInit() {
    if (isPlatformBrowser(this.platformId)) {
      this.createPlot();
      this.updatePlot();
    }
  }

  ngOnChanges() {
    this.updatePlot();
  }

  ngOnInit() {
    this.data = this.data.filter(d => d.presentationDate > "2009-12-31" && d.presentationDate < "2019-12-31");
    this.selectedData = this.data.filter(d => d[this.selectedVar]);
  }

  createPlot() {
    this.element = this.chartContainer.nativeElement;

    // Append SVG
    this.svg = d3.select(this.element)
      .append('svg')
      .attr("class", "dot-plot")
      .attr("width", this.width + this.margin.left + this.margin.right)
      .attr("height", this.height + this.margin.top + this.margin.bottom)
    // .style("background", "#98AED4");

    // selectors
    this.chart = this.svg.append("g")
      .attr("id", "dotplot")
      .attr("transform", `translate(${this.margin.left}, ${this.margin.top})`);


    this.y = d3.scaleLinear();
  }

  prepData() {
    let formatTime = d3.timeParse("%Y-%m-%d");

    this.data.forEach(d => {
      if (d.presentationDate) {
        d['presentationWeek'] = moment(d.presentationDate).endOf("isoWeek");
        d['presentationMonth'] = moment(d.presentationDate).endOf("month");
        d['presentation'] = formatTime(d.presentationDate);
      } else {
        d['presentationWeek'] = null;
        d['presentationMonth'] = null;
        d['presentation'] = null;
      }
    })

    console.log(this.data)

    this.data.sort((a, b) => a.evalDate < b.evalDate ? -1 : 1);

    this.allData = this.summarizeData(this.data);
    this.selectedData = this.summarizeData(this.selectedData);

    console.log(this.allData)
  }

  summarizeData(data) {
    let summary = d3.nest()
      .key((d: any) => this.timeAggregatorFunc(d['presentation']) as any)
      // .key((d: any) => d.agPositive)
      .rollup((values: any[]) => values.length as any)
      .entries(data.filter((d: any) => d.presentation));

    summary.map(d => {
      d['keyDate'] = d3.isoParse(d.key)
    })

    summary.sort((a: any, b: any) => a.keyDate - b.keyDate);

    return (summary)
  }

  updatePlot() {
    this.prepData();

    // --- update axes ---
    this.x = d3.scaleTime()
      .domain(d3.extent(this.allData, d => d['keyDate']))
      .range([0, this.width]);

    this.y
      .range([this.height, 0])
      // .rangeRound([0, this.height])
      .domain([0, this.yMax]);
      // .domain([0, d3.max(this.selectedData, d => d.value)]);

      // let firstYear  = this.x.domain()[0].timeYear();

      this.drySeason = d3.timeMonth.range(new Date(2009, 10, 1), new Date(2019, 10, 1), 12).map(d => {
        return({ start: d, end: moment(d).add(6, 'months')})
      })
      console.log(this.drySeason)

    this.area = d3.area()
      .curve(d3.curveLinear)
      .x((d: any) => this.x(d.keyDate))
      .y0(this.y(0))
      .y1((d: any) => this.y(d.value));

    this.line = d3.line()
      .x((d: any) => this.x(d.keyDate))
      .y((d: any) => this.y(d.value));


    console.log(this.y)

    // --- call axes ---
    this.xAxis = d3.axisBottom(this.x);
    this.yAxis = d3.axisLeft(this.y);

    this.svg.append('g')
      .attr('class', 'dotplot-axis axis--x')
      .attr('transform', `translate(${this.margin.left}, ${this.height + this.margin.top})`)
      .call(this.xAxis);

    this.svg.append('g')
      .attr('class', 'dotplot-axis axis--y')
      .attr('transform', `translate(${this.margin.left}, ${this.margin.top})`)
      .call(this.yAxis);

    // --- area ---
    this.chart.append("path")
      .datum(this.selectedData)
      .attr("class", "epi-path epi-path--selected")
      .attr("fill", "steelblue")
      .attr("d", this.area);

    // --- line ---
    // this.chart.append("path")
    //   .datum(this.allData)
    //   .attr("class", "epi-line epi-line--all")
    //   .attr("d", this.line);

    this.chart.append("path")
      .datum(this.selectedData)
      .attr("class", "epi-line epi-line--selected")
      .attr("d", this.line);

      // --- enter / exit dot data ---
      let dotGroup = this.chart
        .selectAll(".dot-group")
        .data(this.selectedData);

      let dots = dotGroup.select(".dot");
      let dots2 = dotGroup.select(".dot2");
      let dots3 = dotGroup.select(".dot3");
      let lollipops = dotGroup.select(".lollipop-stick");

      // --- exit ---
      dotGroup.exit()
        .remove();

      // --- enter ---
      let dotGroupEnter = dotGroup.enter() // enter the text
        .append("g")
        .attr("class", "dot-group");



      // let lollipopEnter = dotGroupEnter.append("line") // enter the first tspan on the text element
      //   .attr('class', 'lollipop-stick')
      //   .attr("x1", 0);

      let dotEnter = dotGroupEnter.append("circle") // enter the first tspan on the text element
        .attr('class', 'dot dot--count')
        .attr("r", 1);


      // --- update/merge ---
      dotGroup = dotGroupEnter
        .merge(dotGroup)
        .attr("id", (d: any) => `${d._id}`); // enter + update


      // Update the position, class, and properties for the count per thing.
      dots.merge(dotEnter)
        .attr("fill", "steelblue")
        // .attr("fill", "none")
        .attr("cy", (d: any) => this.y(d.value))
        .attr("r", 3)
        .attr("cx", (d: any) => this.x(d.keyDate))
    //


    // --- rects for seasonality ---
    this.chart.selectAll(".dry-season")
    .data(this.drySeason)
    .enter().append("rect")
    .attr("class", "dry-season")
    .attr("x", d => this.x(d.start))
    .attr("width",d => this.x(d.end) - this.x(d.start))
    .attr("y", this.y(this.yMax))
    .attr("height", this.height)


  }

